import "./styles.css";


function Login(){
    return(
        <div className="Login">
            <div className="body">
                <h1>로그인</h1>
                <form>
                    <input className="id_input" type="text"></input><br/>
                    <input className="id_input" type="password"></input>
                </form>
            </div>
        </div>
    )
}

export default Login;
